(8, 2, 5, '6 top takeaways from ', '6-top-takeaways-from', 'studies22.jpg', 'parents.jpg', '6 things your teen should know to become a better learner – from Dr Barbara Oakley', 'It’s good to be a slow learner', 'Poor memory can be a sign of creativity', 'Being a genius is overrated', 'It&rsquo;s easy to spend a lot of time working out what to study and how to do better at school', 'Yes, you read that right. Although there are some learners out there who seem to absorb new information like a sponge, that&rsquo;s not the only way to succeed. Barbara tells us, &ldquo;some people are really fast learners, they&rsquo;re like race car brains, they can get to the finish line really fast. Other people are more like hiker runners, they can get to the finish line, but it&rsquo;s a lot slower. As they&rsquo;re walking though, think about what they experience. I mean they can reach out, they can touch the leaves on the trees, they can smell the pine in the air, see the birds. It&rsquo;s a completely different experience and in some ways far richer and deeper.&rdquo; So although it might feel frustrating not to understand new concepts right away, the process of carefully listening, studying and taking the time that&rsquo;s needed to really get your head around a subject can mean that new knowledge really sticks in the brain. So if you&rsquo;re a slow learner, as long as you put the time in &ndash; it&rsquo;s a blessing in disguise.', 'This one might also sound like a prank, but really it&rsquo;s a scientific fact, we swear (well, Barbara swears!). Just like with quick learners, there are some clever clogs out there who can easily remember lots of facts, but taking the time to fix new info in your brain can mean it&rsquo;s more likely to stay in there for good. For those learners who don&rsquo;t hold brand new pieces of information in their head very well, they often get distracted by something else as they&rsquo;re learning, and what they had in their mind for a moment falls out. But, as Barbara tells us, &ldquo;when something falls out of your brain, something else comes in, and these individuals are often very creative. So poor memory can often go with creativity, and you don&rsquo;t want to give that up. Do you have to work harder to keep up with the intellectual Joneses? Absolutely. But as you will see it works very well.&rdquo; So we&rsquo;ve got two learnings here: 1) those with poorer memories need to put more time in going over information so they can work it into their long term memory, and 2) the flipside of having a poor memory can be creative thinking, which is an awesome skill they should always value. Nice!', 'No offence to any geniuses reading this (but thanks for stopping by, Einstein). What Barbara means by this is that always being right can lead to a poorer learning attitude; know-it-alls can become less inquisitive and therefore, sometimes, less able to consider different perspectives and points of view: &ldquo;The problem with geniuses is they&rsquo;re so used to learning quickly, always being right, that they jump to conclusions, don&rsquo;t look carefully at what&rsquo;s going on in the real situation and can&rsquo;t change their minds when they&rsquo;re wrong. So if you are no genius, rejoice, because sometimes you can do things that even geniuses cannot&ldquo; And in terms of success at school, this wisdom from Barbara can help teens see that a huge part of academic success comes from a healthy attitude towards learning, rather than an in-born ability that you either have or don&rsquo;t. So whatever grades, university degree or career they have their eyes on, nothing is impossible if they put their mind to it.', NULL, '1', 'null', '', '', '', '', '', '', '2021-10-08 01:42:35', '2021-10-08 02:42:35', '1'),
(9, 3, 8, 'Dyslexia tips from a dyslexic tutor', 'dyslexia-tips-from-a-dyslexic-tutor', 'Dyslexia1.png', 'relationship1.png', 'Dyslexia tips from a dyslexic tutor', 'What is dyslexia?', 'Building a relationship', 'Practical adjustments', 'This is a guest blog post written by Rachel Durban, a French and English tutor on A2ZTutorials, for Dyslexia Awareness Month.', 'First, it&rsquo;s crucial that we understand what dyslexia really is. Defined by the British Dyslexia Association as a &lsquo;specific learning difference&rsquo;, dyslexia affects how the brain processes information. This neurodivergence is not in itself a problem. In fact, there are many strengths thought to stem from dyslexic thinking. However, as neurodivergent learners try to fit into the mould of a &lsquo;neurotypical&rsquo; world, their difficulties often become more apparent than their strengths.', 'The first step towards your student&rsquo;s success is building a trusting student-tutor relationship. Your pupil needs to know that they can make mistakes in front of you without embarrassment, and their parent needs to know you&rsquo;re not afraid of their child&rsquo;s difficulties. This relationship begins in the free meeting. Usually, a parent or student will bring up any additional learning difficulties without a prompt. It&rsquo;s up to you to react to this in a calm, informed manner. An effective way to do this is to ask about specific adjustments, such as whether the student uses a coloured overlay when they&rsquo;re reading &ndash; asking questions like this shows your understanding of the options available to dyslexic students. These specific questions also avoid asking things like &lsquo;do you find spelling difficult&rsquo;, which suggests an immediate negative judgement of the student&rsquo;s potential.', 'Having been informed about a student&rsquo;s dyslexia, there are many practical ways in which you can bring out their best work in your lessons. Creating accessible resources is a big step towards reducing their stress and emphasising their strengths.You can try:Using fonts which make letters seem less crowded. Sans serif fonts like Comic Sans and Calibri, or downloadable fonts designed for dyslexic readers can be helpful', NULL, '1', 'null', '', '', '', '', '', '', '2021-10-09 06:45:21', '2021-10-09 07:45:21', '1'),
(10, 1, 4, '5 ways to manage your study worries', '5-ways-to-manage-your-study-worries', 'study1.jpg', 'study21.png', '5 ways to manage your study worries (and get the grades you need)', 'Find out what’s involved', 'Plan out your academic year', 'Get help whenever you need it', 'When you&rsquo;re at school, each year brings with it bigger and bigger challenges.', 'Whatever grades you want to achieve by the end of the year, you should start by taking a look at the full curriculum for all your subjects and topics. These are available on the websites of all the exam boards. When you know what and how much you&rsquo;ll need to learn, you should familiarise yourself with the assessment objectives for each grade boundary. You should also let your teachers know what grades you&rsquo;re aiming for &ndash; this will mean they can help you keep on track and get to the standard you need to by exam time.', 'Once you know what exactly you need to learn and by when, you should make a study plan for the whole academic year. You can list what modules you&rsquo;ll be covering by when, and plan when to revisit topics so you don&rsquo;t forget what you learnt first in the year. When you know what you want to achieve by the end of each term, you can then work backwards and make a plan for what to master by the end of each week (plus any extra reading). Again, make sure you ask your teacher which modules you&rsquo;ll be covering in which terms, so your study plan can reflect your classroom learning.', 'It can feel embarrassing sometimes to admit that you&rsquo;re struggling with a particular topic, or subject, or everything. When you&rsquo;re learning though, absolutely everyone gets stuck sometimes &ndash; and the clever thing is to ask for help. At school, your teachers are literally there to help you learn the curriculum, and you&rsquo;re helping them by telling them when you need some more help.', NULL, '1', 'null', '', '', '', '', '', '', '2021-10-08 19:02:57', '2021-10-08 20:02:57', '1'),
(11, 2, 5, 'It’s good to be a slow learner', 'it-s-good-to-be-a-slow-learner', 'parents1.jpg', 'learner2.png', 'It’s good to be a slow learner', 'It’s good to be a slow learner', '', '', 'It&rsquo;s easy to spend a lot of time working out what to study and how to do better at school', 'Although there are some learners out there who seem to absorb new information like a sponge, that&rsquo;s not the only way to succeed. Barbara tells us, &ldquo;some people are really fast learners, they&rsquo;re like race car brains, they can get to the finish line really fast. Other people are more like hiker runners, they can get to the finish line, but it&rsquo;s a lot slower. As they&rsquo;re walking though, think about what they experience. I mean they can reach out, they can touch the leaves on the trees, they can smell the pine in the air, see the birds.', '', '', NULL, '0', '[\"8\"]', '', '', '', '', '', '', '2021-10-08 18:30:17', '0000-00-00 00:00:00', '1'),
