INSERT INTO `tbl_faq` (`faq_id`, `faq_topic_id`, `question`, `answer`, `status`, `added_on`, `updated_on`) VALUES
(2, 1, 'For whom do we offer our services to. ', 'Our services are open for all. Our focus area is mainly primary and secondary schoo kids but we also offer some adult tuition experience.\r\n', '1', '2021-06-18 07:31:22', '2021-10-29 10:49:05'),
(3, 1, 'Who are the A2Z Tutors ?', 'Tutors at A2Z are committed teachers&amp; University students who are experts in their respective subjects. Before tutors can offer online classes, they have to pass a thorough quality check and training programme.', '1', '2021-06-09 04:17:22', '2021-08-10 20:21:10'),
(4, 1, 'What are the benefits of online tutoring?', 'Lessons are Interactive &amp; can be recorded for future revision Remote access from everywhere -just need wi-fi (parents can log in remotely by simply clicking a link and monitor tuition sessions) Non evasive and private (you don&rsquo;t need a tutor to come directly into your private home) More access to our substantial list of national tutors across the whole country whereas face to face tuition limits you to local tutors only. Afffordable and lower prices than face to face\r\n', '1', '2021-06-09 04:18:01', '2021-10-29 03:06:13'),
(5, 1, 'How to find a tutor?', 'Finding a tutor is very easy. Whatever you need, you can search and filter by subject, level, price and many more.View our tutors, and narrow your search by subject, academic level or price. Or if you\'d like expert help, you can book a free session with our team who will assist you to find a suitable tutor. You can compare tutor profiles and learn about their background, experience and availability. Don\'t forget to look at their reviews from parents and students! Message a tutor (or two, or three) and book your free meeting at a time that suits you. Book a lesson and pay as you go. There are no hidden costs and you can skip or cancel any time.', '1', '2021-06-09 04:18:28', '2021-08-10 21:00:38'),
(8, 1, 'How do online lessons work?', 'Our virtual classrooms uses a live video chat, messaging and an interactive whiteboard - this makes it easy for students and tutors to talk to each other, discuss tricky concepts and do practice questions together. The innovative teaching software allows for a natural back-and-forth conversation between tutor and student- just like on FaceTime, Whatsapp and other apps teens use all the time.', '1', '2021-06-09 04:18:51', '2021-08-10 21:01:39'),
(9, 1, 'How do I become a tutor? ', 'Register via our website on the &ldquo;Become a Tutor&rdquo; page. Our team of expert recruiters will follow up your enquiry and call you to discuss all the documents required to register with us.', '1', '2021-06-09 04:19:12', '2021-08-10 21:01:54');
