(3, 0, 0, '', 'jonny@gmail.com', '', '', '00:00:00', 'Jonny Sen1', 'Techno India', '07894563214', 'Mr', '', '', 'Male', 'kolkata', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'As of 2020 it has been twelve since I first began studying politics at Sixth Form and the field has only become more fascinating .', 'As of 2020 it has been twelve since I first began studying politics at Sixth Form and the field has only become more fascinating .', 'test21.jpg', 'Political Theory (Doctorate) ', '43', 'null', 'null', 3.7, '', 2, '', 'As of 2020 it has been twelve since I first began studying politics at Sixth Form and the field has only become more fascinating .', 'My philosophy is that intrigue and fascination always come before learning; the best students are those who genuinely want to learn and the best teachers are those who stoke that genuine interest. Both politics and philosophy are particularly suited to this kind of approach as they&nbsp;touch&nbsp;aspects of life that everybody cares about; the role of teaching them is to demonstrate this connection.', '81dc9bdb52d04dc20036dbd8313ed055', '0', '0', '0', '', '[\"Maths\",\"Physics\"]', 0, '', '1', '', '', '0', '2021-09-10 10:36:51', '0000-00-00 00:00:00', '1'),
(4, 3, 0, 'lizzie-w', 'lizzie@gmail.com', 'lizziew@courtauld.ac.uk', '', '00:00:00', 'Lizzie W', '', '', 'Ms', 'Lizzie', 'W', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I’m a friendly, positive and experienced primary school teacher who specialises in English and Maths tutoring.', '', 'Lizzie_W_jpg.png', '', '20 - 25', 'null', 'null', 4.7, '', 45, '', 'I love teaching and working with children to unlock their potential. I believe when a child is given the right support and attention, they feel happier and more motivated to learn. I specialise in primary English and Maths tutoring; however, I have experience in KS3 English tutoring too. I pride myself on having effective communication skills and bringing a positive energy to all sessions. I regularly receive excellent feedback from students and parents and find tutoring fulfilling, it is rewarding to watch students achieve their best and start to love subjects they once struggled with.', 'I believe learning should be fun and enjoyable and I like to plan engaging lessons where all students feel success and understanding. My sessions focus on breaking down learning into smaller steps, modelling effectively and practising to build confidence. I provide feedback to students and parents during and after sessions and work collaboratively with all parties to ensure progression is made.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"English\"]', 35, '', '1', '', '', '0', '2021-12-09 19:22:38', '0000-00-00 00:00:00', '1'),
(35, 3, 0, 'krish-s', 'krish@gmail.com', 'krishs@courtauld.ac.uk', '', '00:00:00', 'Krish S', '', '', 'Mr', 'Krish ', 'S', 'Male', '', '', '', 'Outside UK', 'UK', '0121231', '2021-06-01', '5 miles', 'German', 'I’m a friendly, dedicated tutor with the aim of making learning fun.', '', 'Krish_S_jpg.png', '', '20-35', 'null', 'null', 4.7, '', 32, '', 'Biology and Medicine are both fields that really interest me, especially at research level – hence me combining the two in the degree I’m currently studying for: Biomedical Science BSc (Hons). At A-Level, I studied Biology, Chemistry, Maths, and Physics achieving A*AAB respectively; I also wrote a dissertation in which I achieved an A. Tutoring is something I’m incredibly passionate about and having received two offers to study Medicine at King’s College London, and Queen Mary University of London, I also offer support in personal statements for biosciences and Medicine, UCAT prep, and Medicine interview workshops.', 'Being a student myself and, having tutored over 30 students over the past two years, I know that the key to achieving the top grades isn\'t \"innate smartness\" or the ability to grind out 100s of past papers until you memorise each exam question that could be asked. Instead, it is the ability to understand, contextualise and apply what you learn. An excellent understanding is the principle behind being able to solve problems, answer questions or even explain concepts to others and it is my aim to help you to achieve exactly that. I hope to also help you increase your self-confidence, develop your problem-solving skills, and achieve the grades that you’re capable of.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"Biology\",\"Chemistry\",\"Science\"]', 29, '', '1', '', '', '0', '2021-12-09 19:21:49', '0000-00-00 00:00:00', '1'),
(37, 3, 0, 'graeme-m', 'graemem@gmail.com', 'graemem@courtauld.ac.uk', '', '00:00:00', 'Graeme M', '', '', 'Mr', 'Graeme ', 'M', 'Male', '', '', '', '', 'UK', '033', '2015-01-05', '20 miles', 'English', 'I am a fully qualified Maths teacher with 20 years\' classroom experience, 15 years of which have been in school leadership positions.', '', 'Graeme_M_jpg.png', ' ', '20 - 35', 'null', 'null', 4.6, '', 48, '', 'I studied Applied Statistics and Business Industry, achieving First class honours. I have worked as a Maths teacher for many years, in a variety of contexts, teaching at secondary schools, Sixth Form colleges and Universities. This breadth of experience has made me an adaptable and capable tutor, who has a comprehensive knowledge of not just the curriculum, but the ways in which students learn.', 'My lessons are fun and interactive, and I have created an array of Virtual Learning Environment (VLE) resources that I use to help push students to the higher grades. My approach is to be a guide to my students, helping them to learn Maths using their own thinking, thus making sessions a shared learning experience.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '1', '', '[\"Maths\",\"ICT\",\"Further Maths\"]', 39, 'Newcastle/North Shields', '1', '', '', '0', '2021-12-09 19:21:18', '0000-00-00 00:00:00', '1'),
(61, 3, 0, 'doug-f', 'doug@gmail.com', 'dougf@courtauld.ac.uk', '', '00:00:00', 'Doug F', '', '', 'Mr', 'Doug', 'F', 'Male', '', '', '', '', 'UK', '', '1999-10-05', '10 miles', 'English', 'Qualified Maths & Further Maths teacher with excellent subject knowledge and over 14 years teaching experience.', 'I am a passionate and results driven teacher, who strives to increase every child’s belief in themselves, to help them achieve their full potential and score fantastic marks.  I find teaching and interacting with my students fulfilling, and I a', 'Doug_F_jpg.png', '', '25-40', 'null', 'null', 4.7, '', 57, '', 'As of 2020 it has been twelve years since I first began studying politics at Sixth Form and the field has only become more fascinating .', 'As of 2020 it has been twelve years since I first began studying politics at Sixth Form and the field has only become more fascinating .', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\"]', 48, '', '1', '', '', '0', '2021-12-09 19:20:44', '0000-00-00 00:00:00', '1'),
