(78, 3, 0, 'david-o', 'david@gmail.com', 'davido@courtauld.ac.uk', '', '00:00:00', 'David O', '', '', 'Mr', 'David', 'O', 'Male', '', '', '', 'Outside UK', 'UK', '012123', '2021-08-18', '5 miles', 'German', 'I am an educated and approachable person, and enjoy teaching and meeting new people.', '', 'David_O_jpg.png', '', '20-25', 'null', 'null', 4.8, '', 67, '', 'I hold a QTS and PGCE with Kingston university and I am registered with the chartered college of nursing, Royal Societies of Chemistry, Physics and Biology. I am a teacher with the nation\'s leading Academy trust and have over 10 years’ tutoring experience. I tutor weekdays and weekends.', 'I love to see students excel in science and maths and believe that every student can learn science and perform very well. I love to present science in the simplest terms to make sure students understand what they are learning, and can then build on this knowledge. My lessons include revision notes, practise questions and past exam questions, to make sure students know how to answer a question to score top marks.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"Science\"]', 58, '', '1', '', '', '0', '2021-12-09 19:20:17', '0000-00-00 00:00:00', '1'),
(79, 3, 0, 'cynthia-t', 'cynthiat@gmail.com', 'cynthiat@courtauld.ac.uk', '', '00:00:00', 'Cynthia T', '', '', 'Ms', 'Cynthia', 'T', 'Female', '', '', '', 'Outside UK', 'UK', '012123', '2021-08-17', '5 miles', 'Spanish', 'Qualified Maths & Science teacher with over 6 years of experience.', '', 'Cynthia_T_jpg.png', '', '20-25', 'null', 'null', 4.6, '', 73, '', 'I am a friendly, enthusiastic and patient tutor that strongly believes that students thrive when they are encouraged and properly supported. I have a Masters in Developmental Psychology, which I believe makes me uniquely qualified to teach, and am also a qualified teacher. My speciality is triple science, which I teach throughout KS3, GCSE and A Level.', 'I like to make lessons engaging and fun with a focus on finding a learning style that suits the student, enabling them to absorb the information in the most effective way possible. Particularly as a Maths and Science teacher, it is always important to give a wider context to the subject matter, to ensure students don’t simply memorise, but have an appreciation of how what they are learning has an impact in the real world.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"Biology\",\"Chemistry\",\"Psychology\"]', 66, '', '1', '', '', '0', '2021-12-09 19:19:52', '0000-00-00 00:00:00', '1'),
(80, 3, 0, 'cynthia-g', 'cynthiag@gmail.com', 'cynthiag@courtauld.ac.uk', '', '00:00:00', 'Cynthia G', '', '', 'Ms', 'Cynthia ', 'G', 'Female', '', '', '', 'Outside UK', 'UK', '012123', '2021-09-04', '5 miles', 'Arabic', 'I am a qualified teacher with over 18 years of highly successful A Levels and GCSE Physics, Chemistry and Biology teaching and tutoring experience.', 'good', 'Cynthia_G_jpg.png', '', '25-35', 'null', 'null', 4.7, '', 44, '', 'I am very passionate about teaching, and have over 18 years of experience teaching at various institutions. I\'m currently working as an online teacher and tutor for various schools and private clients in London. I also teach physics at IGCSE and A Level at a Cambridge International School. My specialties are Maths and Sciences (Chemistry, Biology and Physics), which I teach up to A level.', 'My lessons are carefully planned and catered for each student, with the aim of improving their confidence in the subject matter, so that they can achieve their potential and earn fantastic marks. I use a variety of online resources, including past exam questions, to cover the curriculum in a comprehensive and engaging manner.', 'e10adc3949ba59abbe56e057f20f883e', '1', '0', '0', '', '[\"Biology\",\"Chemistry\",\"Physics\",\"Science\"]', 38, '', '1', '', '', '0', '2021-12-09 19:18:47', '0000-00-00 00:00:00', '1'),
(81, 3, 0, 'asad-u', 'asad@gmail.com', 'asadu@courtauld.ac.uk', '', '00:00:00', 'Asad U', 'Queen Mary University of London', '', 'Mr', 'Asad ', 'U', 'Male', '', '', '', 'Outside UK', 'UK', '012123', '2021-08-11', '5 miles', 'English', 'I am a warm and kind-hearted individual who is a well-trained tutor. I study Mathematics at Queen Mary University of London; I am in my final year of studies.', 'good', 'Asad_U_jpg.png', 'Mathematics final year', '20-25', 'null', 'null', 4.8, '', 65, '', 'Studying maths at university level shows that I highly enjoyed this subject in all my schooling years. In my A levels I achieved ABB in Maths, Further Maths and Chemistry respectively. Reaching further education, I was helping year 7s and 8s to learn their times tables. As an older student I felt the responsibility to help young students and to aid them in understanding topics they were struggling with. I have now decided to dedicate my spare time to tutoring young students, with the aim of helping them achieve their desired grades at GCSE.', 'My mission as a tutor is to make the sessions engaging and easy-to-follow; to reassure students about new topics that may sound unusual to them. Homework will be supplied and support for homework can be discussed during lessons. Review tests will be provided and marked, where I can track the students’ progress', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\"]', 55, '', '1', '', '', '0', '2021-12-09 19:17:59', '0000-00-00 00:00:00', '1'),
(82, 3, 0, 'amal-s', 'amal@gmail.com', 'amals@courtauld.ac.uk', '', '00:00:00', 'Amal S', '', '', 'Ms', 'Amal', 'S', 'Female', '', '', '', '', 'UK', '012123', '2021-08-20', '5 miles', 'English', 'I am a friendly and qualified teacher, specialising in English as a second language, Dutch and Primary education.', '', 'Amal_S_jpg.png', '', '20-25', 'null', 'null', 4.7, '', 47, '', 'I have a Postgraduate Certificate of Education, and am also a qualified English Language teacher for adults. I enjoy teaching, and have been devoting myself to education for over 9 years, working both face-to-face and online. I pride myself on my work ethic, and my ability to engage students from young to old and improve their confidence in their studies.', 'My sessions are carefully prepared to ensure they are interactive and fun, given I am often teaching English or Dutch to beginners, or helping young children who may struggle to focus. I hope that you will enjoy having me as your teacher!', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"English\",\"Dutch\",\"English (Foreign Language)\"]', 43, '', '1', '', '', '0', '2021-12-09 19:13:08', '0000-00-00 00:00:00', '1'),
(84, 3, 0, 'abbey-b', 'abbey@gmail.com', 'abbeyb@courtauld.ac.uk', '', '00:00:00', 'Abbey B', '', '', 'Ms', 'Abbey ', 'B', 'Female', '', '', 'kolkata', 'Kent', 'UK', '012123', '2021-08-26', '10 miles', 'English', 'I am an enthusiastic and friendly individual, and I have a passion for helping people achieve their full potential in English studies.', 'Good', 'Abbey_B_jpg.png', '', '20-30', 'null', 'null', 4.8, '', 64, '', 'I have always had a passion for English, I love the creativity and freedom that the subject enables. Currently, I am in my final year at the University of Kent studying English and American Literature, with aspirations to pursue a career in the field of Journalism alongside managing a tutoring business', 'Firstly, I believe it is incredibly important to establish a rapport and trusting relationship with my students. My lessons are constructed to help students reach their full potential and ignite an interest in the subject, to enhance improvement. I create personalised review trackers, in depth feedback and progress check-ups with parents to ensure the student maximises the lesson and myself!', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '1', '', '[\"English\",\"English Literature\"]', 56, 'Canterbury, Kent, CT2 5-mile radius', '1', '', '', '0', '2021-12-09 19:17:18', '0000-00-00 00:00:00', '1'),
