(94, 3, 0, 'ade', 'ade@gmail.com', 'ade@courtauld.ac.uk', '', '00:00:00', 'Ade', '', '', 'Ms', 'Ade', '', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Medical Degree in Pharmacology+ Diploma in Education.', '', 'Ade_jpg.png', 'Pharmacology+ Diploma', '20-30', 'null', 'null', 4.8, '', 64, '', 'I have a Bachelor’s degree in Pharmacology at University of Portsmouth. I also have a Diploma in Education – London School of Academics. I specialise in 11+ tutoring, including Maths, English and Verbal & Non-verbal reasoning. Furthermore, I have a huge passion for STEM subjects and I have over 15 years\' experience teaching in schools and in tuition centres. I tutor all 3 Science subjects, as well as Maths.', 'No two students have the same learning style, and therefore no two sessions should be the same. These will be tailored to the needs of each student in order to ensure that they get the most out of each tutoring session. I believe exam technique is just as important as understanding the content, and is something that is guaranteed to be incorporated as part of each session.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"English\",\"Biology\",\"Chemistry\",\"Verbal & Non-verbal Reasoning\"]', 56, '', '1', '', '', '0', '2021-12-09 19:11:17', '0000-00-00 00:00:00', '1'),
(100, 3, 0, 'lucky', 'lucky@gmail.com', 'lucky@courtauld.ac.uk', '', '00:00:00', 'Lucky', 'UCL', '07894563214', 'Mr', '', '', 'Female', '', '', '', 'Outside UK', 'UK', '', '0000-00-00', 'home', 'English', 'An experienced tutor that will ensure you achieve your best grade! I am a UCL Masters graduate in science.', '', 'Lucky.png', '', '20-25', 'null', 'null', 4.8, '', 53, '', 'Maths and science have always piqued my interest! I received A*s in all three sciences and maths at GCSE. This led to me studying Biology, Chemistry, Maths, and Statistics at A level, where I obtained AAA. I am now a UCL graduate with degrees in BSc Pharmacology and MSc Drug Discovery and Pharma Management, and I tutor part-time to spread my enthusiasm for the subjects and encourage students to do their best.', 'I like to make my sessions enjoyable and personalized because I believe that every student learns differently. I encourage students to do their best and help them gain confidence, especially when answering exam questions, which can be very intimidating. My teaching style is to break topics down and build students\' knowledge so that information is clear, and they have a thorough understanding of all topics. Knowing the \"why\" behind science and maths, in my opinion, improves comprehension and exam performance significantly.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"Biology\",\"Chemistry\"]', 46, '', '1', '', '', '0', '2021-12-09 19:10:28', '0000-00-00 00:00:00', '1'),
(101, 3, 0, 'martina-c', 'martina@gmail.com', 'martinac@courtauld.ac.uk', '', '00:00:00', 'Martina C', '', '', 'Ms', 'Martina ', 'C', '', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am a friendly and experienced tutor, and I’ve just graduated from Imperial College London!', '', 'Martina_C_jpg.png', '', '20-35', 'null', 'null', 4.8, '', 46, '', 'I have always loved Maths and Physics, and studied both, as well as Further Mathematics, at A Level, achieving A*AA* respectively. Afterwards, I went on to study an integrated Masters in Mechanical Engineering, where I gravitated towards helping other students – working as an Undergraduate Teaching Assistant during my last year of uni. Since graduating, I have dedicated myself fully to tutoring, with the aim of helping students achieve their best.', 'My priority as a tutor is to make lessons engaging and enjoyable, with the ultimate goal of increasing each student\'s self-confidence and ability. I tailor my teaching style and homework support depending on the needs of each individual I tutor, as well as providing review tests and feedback to help mark progress.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '1', '', '[\"Maths\",\"Physics\",\"Science\",\"Further Maths\"]', 40, 'S17, Sheffield', '1', '', '', '0', '2021-12-09 19:09:57', '0000-00-00 00:00:00', '1'),
(102, 3, 0, 'munashe-m', 'munashe@gmail.com', 'munashem@courtauld.ac.uk', '', '00:00:00', 'Munashe M', '', '', 'Mr', 'Munashe', 'M', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am a self-motivated tutor with nine years of experience in teaching different ICT courses.', '', 'Munashe_M_jpg.png', '', '20-25', 'null', 'null', 4.8, '', 66, '', 'My love for computers started during my high school period where I actively participated in the Computer Club. Afterwards, I went on to study Information Systems at Rhodes University, majoring in Computer Science and Information Systems. Since I completed my first degree, I have been teaching ICT courses and helping student realise their dreams in computers. When I finished my master’s in Information Systems and Digital Innovation from the London School of Economics and Political Science, I resolved to continue teaching and tutoring learners who want to realise their goal in computer-related careers.', 'In my sessions, the student leads the learning, and I guide. The learner-centred approach develops an independent and self-reliant learner who can solve challenges at hand with confidence. I make it a must that the learner releases that learning is not a once-off event but a lifetime process, where the past learning experiences inform future learning outcomes. Each activity and exercise add meaning and value to the learning journey.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Computing\",\"ICT\",\"Computer Science\"]', 60, '', '1', '', '', '0', '2021-12-09 19:08:59', '0000-00-00 00:00:00', '1'),
(103, 3, 0, 'nussrat-h-', 'nussrat@gmail.com', 'nussrath@courtauld.ac.uk', '', '00:00:00', 'Nussrat H ', '', '', 'Ms', 'Nussrat', 'H', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I have a bubbly personality and enthusiastic approach to teaching.', '', 'Nussrat_H_jpg.png', '', '20 - 35', 'null', 'null', 4.7, '', 72, '', 'I am an experienced teacher, having achieved my QTS, before working for over 10 years in different schools and Sixth Form colleges. My subject specialty is Mathematics, which I teach at KS3, GCSE and A level. Maths is a fantastic subject for bridging differences, and encouraging students to have a problem-solving mindset, and I hope to bring this alive for students. I have taught mostly in the UK but also internationally in Italy and Saudi Arabia.', 'My teaching style is very flexible and I constantly adapt it to meet the needs of my student. My main focus is to help my student reach their target grades - this is what brings me true joy! I always encourage students to ask as many questions as possible in lessons, as this improves understanding, so it is always important to me to create an environment where they feel encouraged and able to make mistakes.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '1', '', '[\"Maths\"]', 60, 'Ilford ', '1', '', '', '0', '2021-12-09 19:04:15', '0000-00-00 00:00:00', '1'),
(104, 3, 0, 'sanjay-r', 'sanjoy@gmail.com', 'sanjayr@courtauld.ac.uk', '', '00:00:00', 'Sanjay R', '', '', 'Mr', 'Sanjay', 'R', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am an experienced tutor with over seven years of experience teaching all levels, including A-levels.', '', 'Sanjay_R.jpg', '', '20', 'null', 'null', 4.8, '', 60, '', 'I work as an Actuary for a reputable insurer with a first-class honour’s degree. I took up teaching in my spare time as it is my passion. I am enthusiastic and have the drive to ensure my students reach the best of their ability. I have had multiple students who have gone on to study medicine, actuarial science, Computer science at prestigious universities. I also make sure that my students are best equipped for their university applications.', 'I tailor my sessions specific to the student to ensure they get the most out. I like to spend the last quarter of the session going through exam questions to ensure they practice exams early on.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '1', '', '[\"Maths\",\"Physics\",\"Science\",\"Further Maths\"]', 53, 'Surbiton – 3-mile radius', '1', '', '', '0', '2021-12-09 19:03:29', '0000-00-00 00:00:00', '1'),
(105, 3, 0, 'shalin-a', 'shalin@gmail.com', 'shalina@courtauld.ac.uk', '', '00:00:00', 'Shalin A', '', '', 'Mr', 'Shalin', 'A', '', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I’m an experienced Maths and Sciences tutor, with expertise in exam technique and a UCL undergraduate in Natural Sciences.', '', 'Shalin_A_jpg.png', '', '20 - 35', 'null', 'null', 4.8, '', 63, '', 'I have always had a passion for problem solving, whether it be in academics or in everyday life. I studied Maths, Further Maths, Biology and Chemistry at A-level, achieving A*AAA respectively. I am currently studying Natural Sciences, with a particular focus on Organic Chemistry and Cell and Molecular Biology. I have been tutoring for nearly 5 years, teaching children of varying abilities.', 'My focus as a tutor is to teach exam technique and problem-solving skills, as this is what will get the student the top grades. It is crucial for the student to be able to apply their prior knowledge and skills to unseen and unfamiliar questions. My sessions have a good balance of worked examples and explanations and independent work, which allows the student to practice the skills that I teach them.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '1', '', '[\"Maths\",\"English\",\"Biology\",\"Chemistry\",\"Science\"]', 56, 'Romford, RM6 6HA (5 miles radius) Camden, WC1E 6DH (5 mile radius)', '1', '', '', '0', '2021-12-09 19:02:46', '0000-00-00 00:00:00', '1'),
(106, 3, 0, 'taz-k', 'taz@gmail.com', 'tazk@courtauld.ac.uk', '', '00:00:00', 'Taz K', '', '', 'Mr', 'Taz', 'K', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am an ambitious and experienced individual who has a strong passion for teaching within the primary age range.', '', 'Taz_K_jpg.png', '', '20 - 25', 'null', 'null', 4.7, '', 50, '', 'I am very enthusiastic about teaching young children. I have worked in children’s settings and primary schools since 2010, and qualified as a primary school teacher in 2017. I have worked with children ranging from 2-11 in age. Having undertaken a longer route into gaining my qualified teacher status, I can confidently say that my preferred age to teach is years 3-4 (ages 7- 9). Due to having a child in 2019, my focus shifted to family duties, therefore I decided to tutor part-time.', 'As a tutor, it is my duty to ensure that my lessons are fun, interactive, and lively so that I can bring out the best in all the children that I teach. The main aim for me as a tutor is to help my students thrive and progress in the most effective way. I strongly believe in positive reinforcement techniques, because this helps my students gain confidence within their learning. Every lesson that I teach is personalised according to the needs of the child. This is crucial for progression, as children learn best when their individual needs are considered.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"English\",\"Science\"]', 45, '', '1', '', '', '0', '2021-12-09 19:02:01', '0000-00-00 00:00:00', '1'),
(107, 3, 0, 'yasmin-a', 'yasmin@gmail.com', 'yasmina@courtauld.ac.uk', '', '00:00:00', 'Yasmin A', '', '', 'Ms', 'Yasmin', 'A', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I have a Bachelors in Teaching, with over 12 years of classroom experience.', '', 'Yasmin_A_jpg.png', '', '20 - 25', 'null', 'null', 4.7, '', 47, '', 'I am an energetic and ambitious teacher with a passion for teaching primary school children in accordance with the national curriculum. This involves planning, teaching and assessing with other colleagues. I have expertise in dealing with a diverse range of children including SEN kids. I adapt my teaching style to suit each child as every child has different learning capabilities.', 'I believe children are only motivated by a positive and encouraging teacher, that makes them feel like they can be themselves whilst also seeing the joys of learning. Therefore, I strive for enjoyable and educations sessions, that use a variety of resources, images, and explanations, so that my students get the best possible experience out of learning.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '1', '', '[\"Maths\",\"English\"]', 38, '', '1', '', '', '0', '2021-12-09 18:47:43', '0000-00-00 00:00:00', '1'),
(108, 3, 0, 'zainab-h', 'zainab@gmail.com', 'zainabh@courtauld.ac.uk', '', '00:00:00', 'Zainab H', '', '', 'Mr', 'Zainab', 'H', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am an experienced and dedicated maths and science tutor who aims to help my students excel in their studies.', '', 'Zainab_H_jpg.png', '', '15 - 35', 'null', 'null', 4.9, '', 40, '', 'I have always enjoyed studying and working through challenging Maths\' problems and worked hard to achieve an A at A-level. I also thoroughly enjoyed my science studies, achieving an 8 and 7s in my GCSEs. I am now studying my degree in Economics and Management.', 'Seeing my students enjoying Maths and Science as they develop in confidence and understand the challenging concepts is very fulfilling. I adapt my teaching style to my students to maximise their potential and stay engaged to allow them to achieve their best.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"English\",\"Science\"]', 35, '', '1', '', '', '0', '2021-12-09 18:47:06', '0000-00-00 00:00:00', '1'),
(132, 2, 0, 'puja-roy', 'puja@gmail.com', '', '', '00:00:00', 'Puja Roy', 'kolkata', '07894563214', '', '', '', 'Female', 'kolkata', 'Pune', 'kolkata', '', 'United Kingdom', '0121231', '2021-08-04', '', '', '', '', 'test4.jpg', 'Political Theory (Doctorate) ', '', '', '', 0, '', 0, '', '', '', '81dc9bdb52d04dc20036dbd8313ed055', '0', '0', '0', '', '', 0, '', '1', '', '', '0', '2021-09-10 19:33:59', '2021-08-31 08:54:41', '1'),
