(138, 2, 0, 'sanjoy-sen', 'sanjoy@gmail.com', '', '', '00:00:00', 'Sanjoy Sen', '', '07894563214', '', '', '', 'Male', 'kolkata', '', 'kolkata', '', '', '033124', '2021-08-31', '', '', '', '', 'test23.jpg', '', '', '', '', 0, '', 0, '', '', '', '81dc9bdb52d04dc20036dbd8313ed055', '0', '0', '0', '', '', 0, '', '1', '', '', '0', '2021-09-22 17:59:14', '0000-00-00 00:00:00', '1'),
(139, 3, 0, 'aderonke-o', 'aderonke@gmail.com', 'aderonkeo@courtauld.ac.uk', '', '00:00:00', 'Aderonke O', '', '', 'Mr', 'Aderonke', 'O', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am a hard-working, friendly Medicine student who loves helping other people!', '', 'Aderonke_O.jpg', 'Medicine', '20 - 25', 'null', 'null', 4.8, '', 53, '', 'I am currently studying Medicine, so I understand first-hand what it is like to be a student. At A level I achieved 4 A*s, in Physics, Chemistry, Biology and Maths, and I have a great understanding of the curriculums for these 4 subjects. I pride myself on my work-ethic and my friendly personality, and I like to make students feel comfortable with me.', 'There are many ways of learning, from writing and condensing revision notes to practising and marking past papers. I strive to pass on these skills and techniques to my students, so that they have everything they need to achieve their best. My lessons will incorporate all these different aspects to create a balanced, engaging lesson.', 'e10adc3949ba59abbe56e057f20f883e', '0', '0', '0', '', '[\"Maths\",\"Science\"]', 48, '', '1', '', '', '0', '2021-12-09 18:43:52', '0000-00-00 00:00:00', '1'),
(140, 3, 0, 'aaron-g', 'aaron@gmail.com', 'aarong@courtauld.ac.uk', '', '00:00:00', 'Aaron G', 'London School of Economics', '', 'Mr', 'Aaron', 'G', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I graduated with a BSc in Politics from the London School of Economics.', '', '', 'BSc', '20 - 35', 'null', 'null', 4.7, '', 30, '', 'I am a very motivated and enthusiastic teacher, who has a wide range of experience teaching many ages and subjects, including Maths & English at primary level, and English Literature, Philosophy and Politics all the way to A level. I have also taught Politics at University level. This variety has given me a solid understanding of these subjects, but also of the ways in which they are connected and the different methods of approaching a text or problem.', 'My lessons vary significantly depending on the level and subject matter I am teaching. For primary school, it is important to engage children by providing images and educational games to supplement lessons. For my older students, I like to provide plenty of real-world examples, as well as essay preparation and exam question practise. In Politics, Literature and Philosophy, it is important to not only understand the theory, but also be able to explain one’s point of view, and hence I encourage this way of thinking in lessons.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"English\",\"English Literature\",\"Politics\"]', 25, '', '1', '', '', '0', '2021-12-09 18:42:06', '0000-00-00 00:00:00', '1'),
(141, 3, 0, 'allan-b', 'allan@gmail.com', 'allanb@courtauld.ac.uk', '', '00:00:00', 'Allan B', 'University of Durham', '', 'Mr', 'Allan', 'B', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am a friendly and experienced tutor, based in Scotland.', '', 'Allan_B.jpg', 'Honours', '25 - 35', 'null', 'null', 4.7, '', 55, '', 'I am qualified teacher with an Honours Degree in Applied Science from University of Durham. Prior to teaching I spent 10 years working in the engineering industry. I have been teaching Maths & Science on a one-to-one basis for over 15 years. Many of my students go on to University, College or Apprenticeship in meaningful employment.', 'I teach online using Skype or FaceTime. I use white boards to undertake the tuition, which allows me to have interactive lessons where the students can go through problems with me in a clear and intuitive “classroom” style. Teaching Maths, Physics and Engineering Science at Nat 5 and Advanced Highers, I have a good understanding of STEM subjects.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"Physics\"]', 48, '', '1', '', '', '0', '2021-12-09 18:41:34', '0000-00-00 00:00:00', '1'),
(142, 3, 0, 'anirban', 'anirban@gmail.com', 'anirban@courtauld.ac.uk', '', '00:00:00', 'Anirban', '', '', 'Mr', 'Anirban', '', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I like meeting new people and helping students achieve their best!', '', 'Anirban.png', 'MBA', '20 - 35', 'null', 'null', 4.7, '', 65, '', 'I have a Business and Computer science background, with a Bachelor of Information Technology, an MBA, and a Masters in Business Information Management. I therefore have a subject specialty with these two topics, which I teach from functional skills and basics, all the way to A level. I have over 7 years of tutoring experience, and I am an adaptable and capable tutor.', 'I believe students are very creative and can hence drift away when learning a vast subject. I approach that problem by adapting my teaching style into a more interactive, visually responsive, and relatable to the students. I believe that we all learn things differently. I emphasize practical applications of the topics and enthuse my students with real-world examples.', 'e10adc3949ba59abbe56e057f20f883e', '0', '0', '0', '', '[\"Business Studies\",\"Computer Science\"]', 56, '', '1', '', '', '0', '2021-12-09 18:38:45', '0000-00-00 00:00:00', '1'),
(143, 3, 0, 'charlie-c', 'charlie@gmail.com', 'charliec@courtauld.ac.uk', '', '00:00:00', 'Charlie C', '', '', 'Mr', 'Charlie', 'C', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am a qualified English Lit. and Lang. teacher up to A level, as well as a certified English as a Foreign Language teacher.', '', 'Charlie_C.png', '', '20 - 35', 'null', 'null', 4.8, '', 64, '', 'I\'m a qualified teacher with experience teaching in language schools in UK & Europe. I teach mostly GCSE and A Level English and Literature. I have experience teaching on an individual basis and also in front of large group of students. I am motivated, enthusiastic and committed to helping students achieve higher grades and gain deeper understanding in English & History.', 'I like to make teaching engaging and meaningful. I am a great believer in meeting the student where they are, and making connections with prior learning. Relationships are key, so I strive to create a safe, fun, trusting environment in lessons. I will liaise with parents if appropriate, to focus teaching on areas of need, or I can take the lead and prepare a programme of study based on exam specifications.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"English\",\"English Language\",\"English Literature\",\"English (Foreign Language)\"]', 57, '', '1', '', '', '0', '2021-12-09 18:39:09', '0000-00-00 00:00:00', '1'),
(144, 3, 0, 'chloe-c', 'chloe@gmail.com', 'chloec@courtauld.ac.uk', '', '00:00:00', 'Chloe C', '', '', 'Mr', 'Chloe', 'C', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Hello, I’m a bubbly and engaging English tutor.', '', 'Chloe_C.png', '', '20 - 25', 'null', 'null', 4.8, '', 56, '', 'I am a highly motivated, hardworking and very well organized person, who studies English and American Literature with Hispanic Studies. During high school, I helped teach in both Spanish and English GCSE classes, helping those who didn’t find the subject easy to learn. This allowed me to work with students at different levels, meaning I needed to adapt to their learning. I thoroughly enjoyed this experience as it is something I wish to pursue.  ', 'I like to have a calm and open approach to lessons, providing space for the student to be themselves, and ask any questions they might have regarding the subject matter. English should be taught in a way that encourages student’s creativity and ability to read between the lines, particularly when analysing texts. I try to lead engaging lessons that motivate students in this way.', 'e10adc3949ba59abbe56e057f20f883e', '0', '0', '0', '', '[\"English\"]', 47, '', '1', '', '', '0', '2021-12-09 18:38:11', '0000-00-00 00:00:00', '1'),
(145, 3, 0, 'fathima-m', 'fathima@gmail.com', 'fathimam@courtauld.ac.uk', '', '00:00:00', 'Fathima M', 'Anglia Ruskin University ', '', 'Mr', 'Fathima', 'M', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am currently studying a BSc in Medical Sciences and tutor in my spare time!', '', 'Fathima_M.png', 'BSc', '20 - 35', 'null', 'null', 4.6, '', 55, '', 'Studying Medical Sciences at Anglia Ruskin University means I have a good understanding of how biology and chemistry are applied in the real world, which I hope will enable me to be an interesting and engaging tutor. I have over 5 years of tutoring experience, having worked as a Teaching Assistant in the classroom, as well as doing one-to-one tutoring both online and in-person.', 'I enjoy being creative and use engaging and varied activities in my lessons to keep the lessons interesting, and allow students to learn in different ways. This includes explaining key concepts with the aid of diagrams and graphics, as well as going through past papers and marking schemes to help students understand how they can score top marks in an exam.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '1', '', '[\"Maths\",\"Biology\",\"Chemistry\"]', 44, 'Slough', '1', '', '', '0', '2021-12-09 18:35:59', '0000-00-00 00:00:00', '1'),
(146, 3, 0, 'graeme', 'Graeme@gmail.com', 'graeme@courtauld.ac.uk', '', '00:00:00', 'Graeme', 'University of Glasgow', '', 'Mr', 'Graeme', '', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'An experienced and approachable tutor!', '', 'Graeme.png', '', '20 - 35', 'null', 'null', 4.8, '', 39, '', 'I have always enjoyed History & Politics, which I studied at the University of Glasgow, before leading a successful career working in the Scottish, UK and European parliaments, with additional experience both lecturing and working in political roles in the not-for-profit sector. I have 20 years of experience teaching History, Government Politics and Modern studies at Higher, Advanced Higher and A levels.', 'I have taught all the major examination boards and my students have consistently achieved their target grades or higher. I work hard to build the confidence of my students by empowering them to believe in themselves. I also give them insights into exam techniques by working through a large variety of past exam papers from the relevant exam boards. All the subjects I teach have a grounding in real life, so I like to encourage students’ curiosity and develop their understanding of the modern world they live in.', 'e10adc3949ba59abbe56e057f20f883e', '0', '0', '0', '', '[\"Government and Politics\",\"History\",\"Modern Studies\"]', 33, '', '1', '', '', '0', '2021-12-09 18:34:58', '0000-00-00 00:00:00', '1'),
(147, 3, 0, 'mark-f', 'markf@gmail.com', 'markf@courtauld.ac.uk', '', '00:00:00', 'Mark F', '', '', 'Mr', 'Mark', 'F', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Fully qualified Chemistry teacher and examiner.', '', 'Mark_F.png', '', '25 - 40', 'null', 'null', 4.8, '', 42, '', 'I am a fully qualified Chemistry teacher with 20 years\' classroom experience, 13 years of which have been in school leadership positions, including Head of Chemistry and Deputy Head Academic at an independent school. I have created loads of online learning materials that I use to help push students to the higher grades of A & A*.', 'I provide high-quality lessons using my extensive knowledge of the Science curriculum. Since I am an examiner, I know not just the knowledge that students need to have to succeed, but also the methods they need to employ when answering exam questions to ensure they achieve top marks. This means I supplement lessons with plenty of exam-style questions, so that students can practise these vital skills.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Biology\",\"Chemistry\",\"Physics\",\"Science\"]', 34, '', '1', '', '', '0', '2021-12-09 18:34:25', '0000-00-00 00:00:00', '1'),
(148, 3, 0, 'melody-l', 'melodyl@gmail.com', 'melodyl@courtauld.ac.uk', '', '00:00:00', 'Melody L', 'University College London', '', 'Mr', 'Melody', 'L', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Currently studying a BA in Classics from University College London.', '', 'Melody_L.png', 'BA', '15 - 25', 'null', 'null', 4.7, '', 36, '', 'With an outgoing and warm personality, I am always keen to help others and am able to think from others’ point of views. Having tutored younger students in Mathematics during sixth form, I am well aware of how to successfully assist and motivate others, and help students to achieve their full potential.', 'As a student, I have recent experience in all of the subjects I teach and understand first-hand points of confusion in the curriculum. This helps me connect with my students, and explain things in a way that they can understand more easily and intuitively. I hope to help my students feel more confident in their abilities, so that they can achieve their potential.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '1', '', '[\"Maths\",\"Latin\",\"Greek\"]', 32, 'Hornchurch', '1', '', '', '0', '2021-12-09 18:24:06', '0000-00-00 00:00:00', '1'),
(149, 3, 0, 'lucy-w', 'lucyw@gmail.com', 'lucyw@courtauld.ac.uk', '', '00:00:00', 'Lucy W', '', '', 'Mr', 'Lucy', 'W', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I love Maths, Physics and Chemistry!', '', 'Lucy_W.png', 'Masters of Physics', '20 - 35', 'null', 'null', 4.7, '', 63, '', 'I have a strong educational background, with a First-class Masters of Physics with Theoretical Physics. I am currently undertaking a PhD in Medical Physics and tutor in my spare time. I aim to be a university lecturer and see tutoring as a really good foundation to a future in university lecturing. I hope to motivate my students to be ambitious individuals, who believe that they can be anything they aspire to.', 'My lessons develop students’ natural abilities to solve mathematical and scientific problems, using a variety of resources to make lessons engaging and interesting. Interactivity is of great importance to me, as this ensures students actively use the knowledge we go through and cement it in their long-term memory.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"Chemistry\",\"Physics\",\"Science\"]', 56, '', '1', '', '', '0', '2021-12-09 18:23:06', '0000-00-00 00:00:00', '1');
