(150, 3, 0, 'luthais-b', 'luthaisb@gmail.com', 'luthaisb@courtauld.ac.uk', '', '00:00:00', 'Luthais B', '', '', 'Mr', 'Luthais', 'B', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I enjoy teaching Mathematics at an advanced level, and am an experienced Maths and Further Maths tutor.', '', 'Luthais_B.png', '', '30 - 40', 'null', 'null', 4.8, '', 62, '', 'I am dedicated, motivated and passionate tutor, who has over 9 years of private tutoring experience, as well as lecturing at the University of Leicester in Applied Mathematics. Over the past years, I have seen changes in the curriculum across the board, across many award agencies. I have developed a robust understanding of the ins and outs of each curriculum, as well as being able to tune my teaching to the style preferableto the students.', 'Given the advanced level of content I teach, it is important that students have a solid grounding in the Mathematical basics, which I ensure by undertaking an initial assessment when I start with a student. After this, I am able to target areas of weakness, and develop their wider understanding of the curriculum with exam questions and in-depth learning.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"Further Maths\"]', 53, '', '1', '', '', '0', '2021-12-09 18:22:26', '0000-00-00 00:00:00', '1'),
(151, 3, 0, 'nabila-n', 'nabilan@gmail.com', 'nabilan@courtauld.ac.uk', '', '00:00:00', 'Nabila N', '', '', 'Ms', 'Nabila', 'N', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Kind and passionate tutor in Maths, Sciences and English.', '', 'Nabila_N.png', '', '20 - 35', 'null', 'null', 4.8, '', 67, '', 'I have over 5 years of teaching experience, having worked as a Teaching Assistant at Queen Mary University, as well as being the Head of KS3 and KS4 Science and Maths at a previous tutoring company. In the latter role, I created detailed lesson plans, learning resources, and supervised classes and other tutors. This experience has made me a capable tutor.', 'I enjoy crafting lessons which are fun and varied for students, with a personalised approach for the points where they require more self-confidence. My teaching style is based on interactive & collaborative approach getting students involved at all stages and working closely with them to bridge their knowledge gaps and improve confidence at the same time.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"English\",\"Physics\",\"Science\"]', 59, '', '1', '', '', '0', '2021-12-09 18:21:54', '0000-00-00 00:00:00', '1'),
(152, 3, 0, 'nehita', 'nehita@gmail.com', 'nehita@courtauld.ac.uk', '', '00:00:00', 'Nehita', 'UCL ', '', 'Ms', 'Nehita', '', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Enthusiastic tutor and medical student.', '', 'nethia_jpg.png', 'Studying Medicine', '20 - 25', 'null', 'null', 4.7, '', 52, '', 'I am currently studying medicine at UCL and have ambitions to become a GP in the future. I see tuition as a way of giving back to society and hope to do that even further once I qualify as a GP. This passion for helping others is what I hope makes me an understanding and patient tutor, as well as my academic record, having achieved A*, A* and A in Chemistry, Biology and Maths respectively.', 'I use an active learning approach to prepare the student to think critically and to be able to work through problems themselves from day one. I will be using questions and problem-solving activities to build up the students’ confidence and getting them to engage with the material. This is the key to successfully applying knowledge and is what really allows them to shine during the exam.', 'e10adc3949ba59abbe56e057f20f883e', '0', '0', '0', '', '[\"Maths\",\"Science\"]', 44, '', '1', '', '', '0', '2021-12-09 18:20:01', '0000-00-00 00:00:00', '1'),
(153, 3, 0, 'nick-b', 'nick@gmail.com', 'nickb@courtauld.ac.uk', '', '00:00:00', 'Nick B', 'The University of Bath', '', 'Mr', 'Nick', 'B', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Qualified Geology and Geography teacher with 20 years of experience.', '', '', 'Masters in Education , Geology & Geography', '20 – 40', 'null', 'null', 4.8, '', 65, '', 'I read Geology & Geography at the University of Bath, before completing my Masters in Education and achieving my Qualified Teacher Status. Subsequently, I began working as a full-time teacher, and I now have over 20 years of classroom experience, as well as 10 years of one-to-one tuition. Furthermore, my work as an examiner means I have good insights on how best to prepare students for exams, and I pass this on to my tutee students.', 'I plan and tailor sessions to suit each student, to ensure development and growth. I use discussion, questioning and examples of work in order to promote a love of learning and subject knowledge. Geography and geology have important applications in the real world, and I enjoy seeing students develop their curiosity and understanding of our planet.', 'e10adc3949ba59abbe56e057f20f883e', '1', '0', '0', '', '[\"Geography\",\"Geology\"]', 55, '', '1', '', '', '0', '2021-12-09 18:19:28', '0000-00-00 00:00:00', '1'),
(154, 3, 0, 'rabia-u', 'rabia@gmail.com', 'rabiau@courtauld.ac.uk', '', '00:00:00', 'Rabia U', '', '', 'Ms', 'Rabia', 'U', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I love helping others learn and seeing them develop into confident students.', '', 'Rabia_U_jpg.png', 'BSc ', '20', 'null', 'null', 4.7, '', 55, '', 'I am a final year medical student, having previously studied a BSc in Chemistry, with a huge passion for helping others. Tutoring is a great medium for me to share knowledge and empower kids to achieve their dreams. I have experience teaching Triple Science and Maths from Year 7 to GCSE, as well as helping children in KS3 with English. This variety of subject matter has developed my range of teaching methods, which helps me design better lessons for students.', 'I believe in active learning, and I structure my lessons in an interactive format customised to suit the learning capabilities of each individual student. I draw my material from a range of sources, making sure to cover the curriculum comprehensively, but also to a student’s understanding of the wider context of everything they learn.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"English\",\"Science\"]', 48, '', '1', '', '', '0', '2021-12-09 18:18:40', '0000-00-00 00:00:00', '1'),
(155, 3, 0, 'sherliza-a', 'sherliza@gmail.com', 'sherlizaa@courtauld.ac.uk', '', '00:00:00', 'Sherliza A', '', '', 'Ms', 'Sherliza', 'A', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Enthusiastic and experienced full-time tutor.', '', 'Sherliza_A_jpg.png', '', '20 - 35', 'null', 'null', 4.8, '', 70, '', 'I have a bubbly personality, which I believe makes me an engaging tutor to my students. I have taught both in the UK and abroad, working as an English Literature and Language teacher as well as teaching English as a foreign language, for which I am qualified with TEFL and IELTS certification. I find teaching extremely rewarding, as I get to see the difference I am making in each student’s life, by way of their improving results and understanding.', 'I take a friendly approach to teaching. Tutoring sessions are specifically geared to the student’s individual needs, and may include functional literacy, close discussion of a set text, exam preparation and revision skills, and past papers. We can follow a specific syllabus, with the flexibility to focus on any particular aspect of the curriculum; or study organically, choosing interesting and challenging texts to read that offer the opportunity to learn effectively while developing a strong set of English skills.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"English\",\"English Language\",\"English Literature\",\"Science\",\"English (Foreign Language)\"]', 60, '', '1', '', '', '0', '2021-12-09 18:17:45', '0000-00-00 00:00:00', '1'),
(156, 3, 0, 'wendy-s', 'wendy@gmail.com', 'wendys@courtauld.ac.uk', '', '00:00:00', 'Wendy S', '', '', 'Ms', 'Wendy', 'S', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I enjoy helping others learn English, and seeing their communication skills improve.', '', 'Wendy_S_jpg.png', '', '20 - 25', 'null', 'null', 4.8, '', 37, '', 'I am a bubbly and experienced teacher with vast experience teaching English as a foreign language, across both the UK education system and also working with the British Council in foreign countries, including New Delhi, Dubai and Indonesia. I am a qualified PGCE teacher, as well as having CELTA and IELTS certification.', 'I really look forward to working together to hit personal growth targets - be that meeting specific exam requirements and/or anchoring your confidence in English generally by growing your skills and knowledge. I structure my lessons to focus on your areas of interest, be they improving general fluency, accuracy, pronunciation or learning more grammatical structures.', 'e10adc3949ba59abbe56e057f20f883e', '1', '0', '0', '', '[\"English (Foreign Language)\"]', 32, '', '1', '', '', '0', '2021-12-09 18:14:29', '0000-00-00 00:00:00', '1'),
(157, 3, 0, 'will-a', 'will@gmail.com', 'willa@courtauld.ac.uk', '', '00:00:00', 'Will A', '', '', 'Mr', 'Will', 'A', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'I am a qualified and fun Business and Economics teacher! Also have extensive experience teaching at Primary School level', '', 'Will_A_jpg.png', '', '20 - 35', 'null', 'null', 4.7, '', 45, '', 'I teach lessons across KS4 and KS5 in the Business Department. Specifically, I currently teach Economics and Business studies at both AS and A2, this is alongside teaching Applied General Business, BTEC Business Level 2, Finance, and Business & Enterprise. As per the job description, I plan and teach lessons within the context of the school’s curriculum and schemes of work. Moreover, as a qualified teacher, I assess, monitor, record and report on the learning needs of my students – ensuring that they are all able to make the required progress. I have also worked as a Primary school Maths and English teacher.', 'My knowledge combined with numerous approaches to any problems allows me to tailor my lessons to students’ needs, making the complex simple, which makes me a successful teacher. My interactive teaching style engages and entertains students, Creating a solid and reliable platform that motivates them in their studies and exams.', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '0', '', '[\"Maths\",\"English\",\"Business Studies\",\"Electronics\"]', 40, '', '1', '', '', '0', '2021-12-09 18:12:20', '0000-00-00 00:00:00', '1'),
(158, 3, 0, 'zaid-a', 'zaid@gmail.com', 'zaida@courtauld.ac.uk', '', '00:00:00', 'Zaid A', '', '', 'Mr', 'Zaid', 'A', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Smart students keen to help others achieve the results I did.', '', 'Zaid_A_jpg.png', '', '15 - 25', 'null', 'null', 4.8, '', 38, '', 'I have a meticulous & systematic approach to learning and revision, which allowed me to achieve straight As in all of my GCSE\'s. Despite being a current A level student myself, I see this as a benefit when it comes to being a tutor, as I understand first-hand the experience, and have recent and extensive knowledge of the curriculum. I see tuition as a way and means to assist others to pass their exams, and improve my own understanding and learning experience at the same time.', 'I structure my lessons in an informative and interactive way in order to maximise the learning experience of the students. I know personally the many forms revision can and should take, in order to ensure long-term memory storage and maximise performance in the exams. This means I can help each student individually, and tailor my lessons to suit the ways in which they each learn.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"English\",\"Science\"]', 35, '', '1', '', '', '0', '2021-12-09 18:04:54', '0000-00-00 00:00:00', '1'),
(159, 3, 0, 'yousuf-h', 'yousuf@gmail.com', 'yousufh@courtauld.ac.uk', '', '00:00:00', 'Yousuf H', '', '', 'Mr', 'Yousuf', 'H', 'Male', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Assistant Biochemistry Assistant, BSc-  Biochemistry', '', 'Yousuf_H_jpg.png', 'BSc-  Biochemistry', '25', 'null', 'null', 4.6, '', 30, '', 'I have a meticulous & systematic approach to learning and revision, which allowed me to achieve straight As from school and a first class degree in Biochemistry. Using the knowledge and experience I have gained through my university degree, as well as the high academic level at which I work at, I teach all Sciences & Maths  up to GCSE level. Explaining scientific and mathematical theories and ideas in a way that\'s understandable to the learner is of utmost importance, and I believe this is the most important criteria in teaching the STEM subjects.', 'I structure my lessons in an informative and interactive way in order to maximise the learning experience of the students. I know personally the many forms revision can and should take, in order to ensure long-term memory storage and maximise performance in the exams. This means I can help each student individually, and tailor my lessons to suit the ways in which they each learn.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"English\",\"Science\"]', 25, '', '1', '', '', '0', '2021-12-09 18:04:11', '0000-00-00 00:00:00', '1'),
(160, 3, 0, 'phebe-b', 'phebe@gmail.com', 'phebeb@courtauld.ac.uk', '', '00:00:00', 'Phebe B', 'Kings College London', '', 'Ms', 'Phebe', 'B', 'Female', '', '', '', '', 'UK', '', '0000-00-00', 'home', 'English', 'Junior Doctor, Medical Degree Kings College London', '', 'Phebe_B_jpg.png', 'Medical Sciences', '25 - 35', 'null', 'null', 4.8, '', 85, '', 'I have a meticulous & systematic approach to learning and revision, which allowed me to achieve straight A’s from school and a first class degree in Medical Sciences. Using the knowledge and experience I have gained through my university degree, as well as the high academic level at which I work at, I teach all Sciences & Maths up to A level. My passion for helping others is what makes me an understanding and patient tutor, as well as my academic record, having achieved A*, A* and A in Chemistry, Biology and Maths respectively in my A levels.', 'I structure my lessons in an informative and interactive way in order to maximise the learning experience of the students. I am a patient and supportive tutor and I like to build strong relationships with my students and create an environment that they feel relaxed and supported as this helps bring out their inner best. I know personally the many forms revision can and should take, in order to ensure long-term memory storage and maximise performance in the exams. This means I can help each student individually, and tailor my lessons to suit the ways in which they each learn.', 'e10adc3949ba59abbe56e057f20f883e', '0', '1', '0', '', '[\"Maths\",\"Science\"]', 56, '', '1', '', '', '0', '2021-11-01 05:27:53', '0000-00-00 00:00:00', '1'),
