INSERT INTO `tbl_testimonials` (`id`, `sender_id`, `teacher_id`, `subjects_id`, `levels_id`, `descrip`, `image_src`, `review_date`, `rating`, `added_on`, `added_by`, `updated_on`, `updated_by`, `status`) VALUES
(4, '2', 4, 2, 2, 'I was a little concerned at first as it was online tutoring but it works brilliantly. Love it and very easy to use. Couldn`t recommend mytutor enough', 'test28.jpg', NULL, 3, '2021-08-04 17:29:11', '', '2021-08-04 18:29:11', 'admin', '0'),
(5, '67', 35, 4, 6, 'I was a little concerned at first as it was online tutoring but it works brilliantly. Love it and very easy to use. Couldn`t recommend mytutor enough', 'test41.jpg', NULL, 3.8, '2021-08-04 20:17:43', 'admin', '0000-00-00 00:00:00', '', '0'),
(6, '131', 94, 5, 2, 'Our services are open for all. Our focus area is mainly primary and secondary schoo kids but we also offer some adult tuition experience.', 'test29.jpg', NULL, 3.5, '2021-08-27 10:26:36', 'admin', '2021-08-27 11:26:36', 'admin', '1'),
(8, '131', 106, 4, 5, 'Our services are open for all. Our focus area is mainly primary and secondary schoo kids but we also offer some adult tuition experience.', 'test210.jpg', NULL, 3.5, '2021-08-27 18:28:22', 'admin', '0000-00-00 00:00:00', '', '1'),
(10, '79', 79, 3, 5, 'I have a medical degree and a Master’s in psychology. Tuition allows me to pass on my knowledge and revision techniques to students who need it most', 'Cynthia.png', NULL, 4.6, '2021-11-01 15:24:02', 'admin', '2021-11-01 15:24:02', 'admin', '1'),
(11, '78', 78, 3, 5, 'I’m a qualified teacher and hence always busy with schoolwork but tutoring for A2Z has been helpful as the flexibility that it provides allows me to fit it around my busy schedule. Also, the pay is very good, and I love the fact that we get paid every week. Highly recommend', 'David.png', NULL, 5, '2021-11-01 22:27:53', 'admin', '0000-00-00 00:00:00', '', '1'),
(12, '106', 106, 4, 13, 'I’m a qualified primary school teacher but now a stay-at-home mum to look after my little one and I am so grateful to have A2Z Tutorials as an employer.\r\nI am able to structure lessons flexibly around my schedule and it gives me a platform to do what I am most passionate about which is helping shape the future of little kids\r\n', 'taz.png', NULL, 4.9, '2021-11-01 22:30:38', 'admin', '0000-00-00 00:00:00', '', '1'),
(13, '598', 101, 3, 9, 'We needed an A level maths tutor to help with our son who was struggling with his course, bark recommend Martina to us and she has been amazing, he was really struggling with his confidence and having time out of collage due to COVID wasn’t helping, since have lessons with Martina we have seen a huge improvement and are so pleased he is making progress and his confidence is slowly getting better and feel that within time it will grow. We have noticed a huge improvement in his maths since having lessons with Martina and want to thank you for helping him with this, would highly recommend Martina to anyone who needs extra support', 'Elizabeth.png', '14 Jan , 2021', 4.8, '2021-11-04 09:28:34', 'admin', '2021-11-04 09:28:34', 'admin', '1'),
(14, '600', 4, 3, 13, 'My children had their first lesson with Lizzie this morning. She was fantastic! My son really dislikes school and my daughter loves it. Lizzie was engaging and very patient. We are really pleased we have made the move to private tutoring. We feel reassured our children are now learning something', 'Lizzie.png', '06 May , 2020', 4.6, '2021-11-04 10:23:40', 'admin', '2021-11-04 10:23:40', 'admin', '1'),
(16, '601', 4, 3, 6, 'Leslie at A2Z was very proactive in contacting me and has helped arrange two separate tutors for French and Maths GCSE. Communication has been easy and both tutors are excellent. Recommended!\r\n', '', '18 May , 2020', 4.8, '2021-11-04 14:01:54', 'admin', '2021-11-04 14:01:54', 'admin', '1'),
(17, '602', 94, 3, 6, 'Their team of professional and experienced tutors were first class and helped improved my son’s grades significantly. We started seeing results and improvement within a month of starting the lessons. Highly recommend for tutoring.\r\n', '', '05 May , 2021', 4.6, '2021-11-04 14:02:17', 'admin', '2021-11-04 14:02:17', 'admin', '1'),
(18, '603', 4, 3, 6, '“A2Z is a very interesting and supporting place for my girls. Leslie takes time to ensure that he provides appropriate teacher that can help.I will recommend this company for anyone needing extra academic support.”\r\n', '', '04 May , 2020', 4.7, '2021-11-04 20:05:47', 'admin', '0000-00-00 00:00:00', '', '1'),
(19, '604', 94, 3, 6, 'Both my son and daughter attended tuition classes at A2Z and both passed first time. The biggest indicator for me was how eager they were both willing to wake up every Saturday morning and attend the lessons without complaining which is not what you get from teenage kids. The lessons were fun, well structured and informative and they learnt a lot from it and also enjoyed it.\r\n', '', '11 June , 2019', 4.8, '2021-11-04 14:02:44', 'admin', '2021-11-04 14:02:44', 'admin', '1'),
(20, '605', 84, 4, 6, 'A2Z tutorials provide a fantastic, 1st class service . My daughter is always looking forward to her maths lessons which wasn’t so previously . Her grades have improved tremendously. I will highly recommend A2Z tutorials.\r\n', '', '28 April , 2020', 4.9, '2021-11-04 14:03:17', 'admin', '2021-11-04 14:03:17', 'admin', '1'),
(21, '606', 94, 3, 6, 'Martina is a very good tutor. I have made tremendous improvements in Maths.\r\n', '', '25 Mar , 2021', 4.9, '2021-11-04 14:01:34', 'admin', '2021-11-04 14:01:34', 'admin', '1'),
(22, '607', 84, 4, 3, 'A2Z tutorials have really helped my grades and levels increase immensely with their smart and friendly tutors', '', '05 May , 2020', 4.7, '2021-11-04 20:43:43', 'admin', '0000-00-00 00:00:00', '', '1'),
(23, '608', 94, 3, 4, 'I signed up for their online sessions and the lessons were so well structured and affordable I managed to sign up for Maths, English & Science. Passed all subjects with A* and now doing Physics , Chemistry & Maths for my A levels. Highly recommend', '', '04 May , 2020', 4.8, '2021-11-04 20:53:40', 'admin', '0000-00-00 00:00:00', '', '1'),
(24, '609', 94, 3, 6, 'I joined A2Z 5 months before my GCSE’s and my predicted grade moved from Grade 5 to Grade 7. My only regret is not joining them sooner. The class sizes are small, with loads of time dedicated to one to one sessions. Highly recommend', '', '11 May , 2020', 4.8, '2021-11-04 21:00:44', 'admin', '0000-00-00 00:00:00', '', '1');
